"use client";

import { useState } from "react";
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  Image,
  TouchableOpacity,
} from "react-native";
import { SafeAreaView } from "react-native-safe-area-context";
import { useNavigation, useRoute } from "@react-navigation/native";
import {
  ArrowLeft,
  Heart,
  MessageCircle,
  Bookmark,
  Share,
  Smile,
  Frown,
  Meh,
} from "../components/icons";
import { theme } from "../styles/theme";
import { Badge } from "../components/ui/Badge";
import { ProgressBar } from "../components/ui/ProgressBar";
import { Tab, TabView } from "../components/ui/Tabs";

const DiaryDetailScreen = () => {
  const navigation = useNavigation();
  const route = useRoute();
  const { id } = route.params as { id: number };

  const [activeTab, setActiveTab] = useState(0);
  const [liked, setLiked] = useState(false);
  const [saved, setSaved] = useState(false);

  // Sample data - in a real app, fetch based on ID
  const diary = {
    id: id,
    date: "2025 / 04 / 23 (화)",
    content: `오늘은 눈을 뜨는 것조차 힘들었다. 무언가 해야 할 일이 분명히 있었던 것 같은데, 머릿속은 안개처럼 뿌옇고, 손끝 하나 움직이는 싫었다. 아무도 나를 기다리지 않는다는 생각이 들자, 하루를 시작할 이유가 없어 보였다. 

하지만 창문 밖으로 들어오는 햇살이 내 얼굴을 비추자 조금씩 마음이 움직이기 시작했다. 오랜만에 창가에 앉아 따뜻한 차 한 잔을 마시며 바깥 풍경을 바라보았다. 

시간은 느리게 흘러갔지만, 그 느림이 오히려 나에게 위안이 되었다. 아무것도 하지 않아도 괜찮다는 생각이 들었다. 오늘 하루는 그저 나를 위한 시간으로 채워도 충분하다.`,
    image: require("../../assets/placeholder.png"),
    emotion: "슬픔",
    aiAnalysis: {
      emotions: [
        { name: "슬픔", value: 65, icon: Frown, color: "#3B82F6" },
        { name: "불안", value: 20, icon: Meh, color: "#F59E0B" },
        { name: "평온", value: 15, icon: Smile, color: "#10B981" },
      ],
      keywords: ["무기력", "고립감", "위안", "자기수용"],
      summary:
        "무기력함과 고립감을 느끼지만 자연과 여유를 통해 위안을 찾고 자기 수용으로 나아가는 과정이 담겨 있습니다.",
      recommendation:
        "가벼운 산책이나 명상을 통해 자연과 연결되는 시간을 더 가져보는 것이 도움이 될 수 있습니다.",
    },
  };

  const handleLike = () => {
    setLiked(!liked);
  };

  const handleSave = () => {
    setSaved(!saved);
  };

  return (
    <SafeAreaView style={styles.container} edges={["top"]}>
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <ArrowLeft color="#FFFFFF" size={24} />
        </TouchableOpacity>
        <TouchableOpacity>
          <Share color="#FFFFFF" size={24} />
        </TouchableOpacity>
      </View>

      <ScrollView showsVerticalScrollIndicator={false}>
        <View style={styles.imageContainer}>
          <Image source={diary.image} style={styles.image} />
          <View style={styles.imageOverlay} />
        </View>

        <View style={styles.contentContainer}>
          <View style={styles.card}>
            <View style={styles.dateContainer}>
              <Text style={styles.date}>{diary.date}</Text>
              <View style={styles.badgeContainer}>
                <Badge label={diary.emotion} variant="primary" />
                <Badge label="AI 분석 완료" variant="secondary" />
              </View>
            </View>

            <Text style={styles.content}>{diary.content}</Text>

            <View style={styles.actions}>
              <View style={styles.leftActions}>
                <TouchableOpacity
                  style={styles.actionButton}
                  onPress={handleLike}
                >
                  <Heart
                    color={liked ? theme.colors.primary : "#6B7280"}
                    fill={liked ? theme.colors.primary : "none"}
                    size={24}
                  />
                </TouchableOpacity>
                <TouchableOpacity style={styles.actionButton}>
                  <MessageCircle color="#6B7280" size={24} />
                </TouchableOpacity>
              </View>
              <TouchableOpacity
                style={styles.actionButton}
                onPress={handleSave}
              >
                <Bookmark
                  color={saved ? theme.colors.primary : "#6B7280"}
                  fill={saved ? theme.colors.primary : "none"}
                  size={24}
                />
              </TouchableOpacity>
            </View>
          </View>

          <View style={styles.tabsContainer}>
            <Tab
              tabs={["AI 분석", "추천"]}
              activeTab={activeTab}
              onTabChange={setActiveTab}
            />

            <TabView activeTab={activeTab}>
              {/* AI Analysis Tab */}
              <View style={styles.tabContent}>
                <View style={styles.analysisCard}>
                  <Text style={styles.sectionTitle}>감정 분석</Text>
                  <View style={styles.emotionsContainer}>
                    {diary.aiAnalysis.emotions.map((emotion, index) => {
                      const Icon = emotion.icon;
                      return (
                        <View key={index} style={styles.emotionItem}>
                          <View style={styles.emotionHeader}>
                            <View style={styles.emotionLabelContainer}>
                              <Icon color={emotion.color} size={16} />
                              <Text style={styles.emotionLabel}>
                                {emotion.name}
                              </Text>
                            </View>
                            <Text style={styles.emotionValue}>
                              {emotion.value}%
                            </Text>
                          </View>
                          <ProgressBar
                            progress={emotion.value}
                            color={emotion.color}
                          />
                        </View>
                      );
                    })}
                  </View>

                  <Text style={[styles.sectionTitle, styles.keywordsTitle]}>
                    키워드
                  </Text>
                  <View style={styles.keywordsContainer}>
                    {diary.aiAnalysis.keywords.map((keyword, index) => (
                      <Badge key={index} label={keyword} variant="outline" />
                    ))}
                  </View>

                  <Text style={[styles.sectionTitle, styles.summaryTitle]}>
                    요약
                  </Text>
                  <Text style={styles.summaryText}>
                    {diary.aiAnalysis.summary}
                  </Text>
                </View>
              </View>

              {/* Recommendations Tab */}
              <View style={styles.tabContent}>
                <View style={styles.analysisCard}>
                  <Text style={styles.sectionTitle}>추천 활동</Text>
                  <Text style={styles.recommendationText}>
                    {diary.aiAnalysis.recommendation}
                  </Text>

                  <View style={styles.recommendedActivities}>
